import Home from './Home';
import { Switch, Route } from 'react-router-dom';
const App = ()=>{
    return (
        <>
        <Switch>
            <Route path="/" component={Home} />
            <Route path="/about" component={About} />
            <Route path="/service" component={Service} />
            <Route path="/" component={Home} />
        </Switch>
        </>
    );
};
export default App;
